import React from 'react';
import Layout from '../core/Layout';
import '../core/card.css';
import '../core/Card'

const Dashboard = () => {
	const viewItems = () => (
		<div className="hm">
			<div className="row">

			  <Card
				img= "https://blog-images.pharmeasy.in/2021/01/04140120/shutterstock_390988804-1.jpg"

				/>
			<Card
						img= "https://media.istockphoto.com/photos/assortment-of-colorful-ripe-tropical-fruits-top-view-picture-id995518546?k=6&m=995518546&s=612x612&w=0&h=jUqcvzOQ4onSN5D_Dd8RJFReuO87-0WpB9RXgeju_Kg="

						/>
						<Card
						img= "https://img1.exportersindia.com/product_images/bc-full/dir_74/2215380/fresh-vegetables-1524910746-3812320.jpeg"

						/>

					</div>
				</div>

	);
	return(
		<Layout
            title="Farmer Dashboard"
            description="easy Farming"
            className="container-fluid" >
			{viewItems()}
         </Layout>	
	)
};

export default Dashboard;
